import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'


const Counter = function (props) {
  return (
    <div>
      <h1>计数数量{props.value}</h1>

      <button>计数 + 1</button>
      <button>计数 - 1</button>
    </div>
  )
};


ReactDOM.render(<App/>, document.getElementById('root'));
